import React from 'react';

const ContainerCreateCard = ({ onClose, children }) => (
  <div className="popup">
    <div className="popup-content">
      {children}
      <button onClick={onClose}>Fechar</button>
    </div>
  </div>
);

export default ContainerCreateCard;
